import {
  Checkbox,
  FormControlLabel,
  FormGroup,
  Radio,
  RadioGroup,
  Typography,
} from "@mui/material";
import React from "react";

const PriceRadio = () => {
  const prices = [
    {
      id: 0,
      name : "Upto Rs.1000",
      value : [0,1000]
    },
    {
      id: 1,
      name : "Rs.1000-10000",
      value : [1001,10000]
    },
    {
      id: 2,
      name : "10000-50000",
      value : [10001,1000]
    }
  ];
  return (
    <>
      <Typography
        variant="h4"
        color="secondary"
        fontWeight="bold"
        marginTop="20px"
      >
        Product Price
      </Typography>
      <RadioGroup
        aria-labelledby="demo-radio-buttons-group-label"
        defaultValue={0}
        name="radio-buttons-group"
      >
        {
            prices.map(price =>{
                return<FormControlLabel value={price} control={<Radio/>} label={price}/>

            })
        }
      </RadioGroup>
    </>
  );
};

export default PriceRadio;
